import React, { useState, useEffect } from "react";
import Circle from "./Circle";

function List() {
  const [rfid, setRfid] = useState("0260434848");
  const peopleInside = [];

  useEffect(() => {
    fetch(`https://online.ntnu.no/api/v1/users/?rfid=${rfid}`)
      .then((res) => res.json())
      .then((res) => peopleInside.push(res.results[0]))
  }, []);

  useEffect(() => {
    fetch(`https://online.ntnu.no/api/v1/users/?rfid=0317066520`)
      .then((res) => res.json())
      .then((res) => peopleInside.push(res.results[0]));
  }, []);


  console.log("PeopleInsd hook:");
  console.log(peopleInside);

  return (
    <div>
      <Circle props={peopleInside} />
    </div>
  );
}

export default List;
